-- Заполняем таблицу игроков, используя filldb.info
UPDATE players SET
	country_id = FLOOR(1 + RAND() * 10),
	club_id = FLOOR(1 + RAND() * 20),
	pos_id = FLOOR(1 + RAND() * 4),
	amplua_id = FLOOR(1 + RAND() * 15),
	skill = FLOOR(45 + RAND() * 55),
	count_ = FLOOR(100000 + RAND() * 100000000);
-- SELECT * FROM players;

